import React, { useState } from "react";

function TableRow(props) {
  const { srNo, accountNo, name, email, balance, contactNo, type } = props;
  const [state, setstate] = useState({
    srNo,
    accountNo,
    name,
    email,
    balance,
    contactNo,
    type,
  });
  console.log(state);
  return (
    <>
      <tr>
        <th scope="row">{state.srNo}</th>
        <td>{state.accountNo}</td>
        <td>{state.name}</td>
        <td>{state.email}</td>
        <td>$ {state.balance}</td>
        <td>{state.contactNo}</td>
        <td>{state.type}</td>
      </tr>
    </>
  );
}

export default TableRow;
